<span class="line"><span style="--shiki-light:#383A42;--shiki-dark:#ABB2BF">Explicit </span><span style="--shiki-light:#A626A4;--shiki-dark:#C678DD">is</span><span style="--shiki-light:#383A42;--shiki-dark:#ABB2BF"> better than implicit.</span></span>
